window.bookSummaryJSON = "<p><b>Do you dare to join us for a scare the likes of which you cannot bear to miss this Halloween?</b> <br> Fae wine will be served. <br> Costumes will be observed. <br> Dress in your Halloween best. <br> You’ll be our guest. <br> We insist you enter the contest. <br> Lealla and Aries will be the judges. <br> They don’t hold any grudges. <br> Magic is not to be used. <br> Shifting is not excused. <br> Originality is key. <br> There won’t be a fee. <br> Only one will prevail, <br> While the others will fail. <br> To entertain the judges with their looks, <br> This will go down in the books <br> As the best party ever, <br> So be sure to be clever. <br> Join us on Halloween. <br> It will be quite the frightening scene. <br> <br> <i>*Please note that this book is not intended to be listened to as a stand-alone, but rather as part of the Paranormals of Avynwood series. It is to be listened to after </i>Ladon's Desire<i> and before </i>Craving Camden<i>.</i></p>"; 
